<map id="plantuml_map_31fe521e-399c-4482-bc93-9392d39e65be" name="plantuml_map_31fe521e-399c-4482-bc93-9392d39e65be">
<area shape="rect" id="id1" href="End.html" title="End is a final pseudo-state with only inputs and no outputs indicating completion of a flow. " alt="" coords="2354,820,2408,876"/>
<area shape="rect" id="id2" href="Join.html" title="Join is a pseudo-state which merges flow parallel execution branches. " alt="" coords="2152,820,2207,876"/>
<area shape="rect" id="id3" href="Fork.html" title="Fork is a pseudo-state which splits flow elements execution into parallel branches. " alt="" coords="2060,820,2116,876"/>
<area shape="rect" id="id4" href="Start.html" title="Start is an initial pseudo-state with only outputs and no inputs indicating start of a flow. " alt="" coords="1190,820,1247,876"/>
<area shape="rect" id="id5" href="Choice.html" title="Choice is a conditional pseudo-state." alt="" coords="1954,820,2025,876"/>
<area shape="rect" id="id6" href="InputPin.html" title="Input is a pseudo-state displayed as a square on the border of the containing parition flow through which calls initiate the flow. " alt="" coords="2242,820,2319,876"/>
<area shape="rect" id="id7" href="ExitPoint.html" title="Exit point is a pseudo-state displayed as a crossed circle on the border of the containing partition flow through which transitions leave the flow. " alt="" coords="1718,820,1797,876"/>
<area shape="rect" id="id8" href="Package.html" title="Package is a container of sub-packages, flows, resources, participants, and artifacts." alt="" coords="208,482,288,538"/>
<area shape="rect" id="id9" href="Activity.html" title="Activity describes something performed by a participant." alt="" coords="1076,816,1157,876"/>
<area shape="rect" id="id10" href="Resource.html" title="Something that is used by participants for completion of flow elements. " alt="" coords="622,665,708,721"/>
<area shape="rect" id="id11" href="OutputPin.html" title="Output pin is a pseudo-state displayed as a square on the border of the containing partition flow through which calls are made to other flow elements." alt="" coords="1282,820,1368,876"/>
<area shape="rect" id="id12" href="EntryPoint.html" title="Entry point is a pseudo-state displayed as a circle on the border of the containing partition flow through which transitions enter the flow. " alt="" coords="1832,820,1919,876"/>
<area shape="rect" id="id13" href="CallEntry.html" title="Mapping of a call key to a call. " alt="" coords="1451,658,1532,727"/>
<area shape="rect" id="id14" href="ExpansionInput.html" title="Expansion input is a pseudo-state which can be used instead of partition start pseudo-state to indicate that the partition flow input is a collection and the flow is executed for each element in the collection." alt="" coords="1404,820,1521,876"/>
<area shape="rect" id="id15" href="ActivityEntry.html" title="Mapping of activity key to an activity or a flow. " alt="" coords="872,658,966,727"/>
<area shape="rect" id="id16" href="ArtifactEntry.html" title="A mapping of an artifact key to an artifact. " alt="" coords="561,1150,656,1219"/>
<area shape="rect" id="id17" href="Service.html" title="Service is a reference to a shared activity used in multiple flows. " alt="" coords="2087,981,2183,1051"/>
<area shape="rect" id="id18" href="Flow.html" title="Flow is a composite activity. " alt="" coords="1362,981,1460,1051"/>
<area shape="rect" id="id19" href="ExpansionOutput.html" title="Expansion output is a pseudo-state which can be used instead of partition end pseudo-state to indicate that the partition flow output is a collection and the output transitions are executed for each element in the collection." alt="" coords="1556,820,1682,876"/>
<area shape="rect" id="id20" href="PseudoState.html" title="Base class for transient flow elements in the flow graph. " alt="" coords="1751,658,1854,727"/>
<area shape="rect" id="id21" href="Participant.html" title="Something that participates in completion of flow elements - a human, an organization, a system. " alt="" coords="174,1150,278,1219"/>
<area shape="rect" id="id22" href="PackageEntry.html" title="Mapping of a sub-package key to a sub-package. " alt="" coords="166,658,273,727"/>
<area shape="rect" id="id23" href="ServiceProvider.html" title="Base class for package elements which can provide services - activities and flows, which can be referenced from other activities and flows. " alt="" coords="542,479,673,538"/>
<area shape="rect" id="id24" href="ResourceEntry.html" title="Mapping of resource key to a resource. " alt="" coords="582,813,695,882"/>
<area shape="rect" id="id25" href="TransitionEntry.html" title="Mapping of an output key to a transition. " alt="" coords="1319,76,1433,146"/>
<area shape="rect" id="id26" href="ParticipantEntry.html" title="Mapping of a participant key to a participant. " alt="" coords="109,1305,226,1374"/>
<area shape="rect" id="id27" href="Relationship.html" title="Relationship between artifacts. " alt="" coords="681,1298,783,1381"/>
<area shape="rect" id="id28" href="Call.html" title="Call is a specialization of transition which has blocking “request-reply” semantics where the calling flow element waits for a response from the callee. " alt="" coords="878,813,1004,882"/>
<area shape="rect" id="id29" href="RelationshipEntry.html" title="Mapping of relationship keys (qualifiers) to a relationships. " alt="" coords="769,1150,898,1219"/>
<area shape="rect" id="id30" href="FlowElementEntry.html" title="Mapping of a flow element key to a flow element. " alt="" coords="2410,1150,2541,1219"/>
<area shape="rect" id="id31" href="Transition.html" title="Transition connects two flow elements, e.g. activities and is navigated when execution of the source element is completed and execution of the target element shall begin. " alt="" coords="1162,272,1280,356"/>
<area shape="rect" id="id32" href="RepresentationEntry.html" title="Mapping of representation key to a representation (diagram). " alt="" coords="230,272,374,356"/>
<area shape="rect" id="id33" href="Artifact.html" title="Input to a flow element, e.g. activity, or an output from a flow element. " alt="" coords="704,961,833,1072"/>
<area shape="rect" id="id34" href="ArtifactParticipantResponsibility.html" title="Responsibility assignments for an artifact at the activity level if different from the activity responsibility assignments." alt="" coords="1038,651,1242,734"/>
<area shape="rect" id="id35" href="FlowElement.html" title="FlowElement is an abstract base class for Flow elements. " alt="" coords="1377,444,1526,573"/>
<area shape="rect" id="id36" href="PackageElement.html" title="Base class for elements which can be contained in a package and as such inherited, overridden, and suppressed." alt="" coords="520,38,661,181"/>
<area shape="rect" id="id37" href="ParticipantResponsibility.html" title="Base class for elements for which participants can responsible for, accountable, consulted, or informed. " alt="" coords="410,255,592,370"/>
</map>
